B.Om=new A.bE("             Firebase ile remote database ve di\u011fer backend ihtiya\xe7lar\u0131n\u0131z\u0131 \xe7ok iyi bir \u015fekilde kar\u015f\u0131layabilirsiniz.\n\n             Fakat bunun en b\xfcy\xfck handikap\u0131 uygulaman\u0131z\u0131n kulland\u0131\u011f\u0131 hizmetlere g\xf6re do\u011fal olarak \xfccretlendirmenin olmas\u0131d\u0131r.\n\n             Appwrite da Firebase gibi bir backend \xe7\xf6z\xfcm\xfcd\xfcr. Fakat en b\xfcy\xfck fark\u0131 self-hosting \xf6zelli\u011finin olmas\u0131d\u0131r. Bu sayede firebase'in \xfccretlendirmesinden kurtulabiliirsiniz.",null,null,null,null,null,null,null,null)
B.On=new A.bE("\n             Layout s\u0131n\u0131rlar\u0131n\u0131 g\xf6sterme, performans \xf6l\xe7\xfcm\xfc ve daha bir\xe7ok \xf6zelli\u011fi olan Dart DevTools gibi muhte\u015fem bir arac\u0131 var.\n\n             Pub.dev gibi derli toplu ve hemen hemen her ihtiyaca art\u0131k cevap verebilecek bir paket y\xf6neticisi var.",null,null,null,null,null,null,null,null)
B.Or=new A.bE("      Gezinmekte oldu\u011funuz web sitesi Flutter ile Getx paketi kullan\u0131larak yap\u0131lm\u0131\u015ft\u0131r ve hen\xfcz geli\u015ftirme a\u015famas\u0131ndad\u0131r.Masa\xfcst\xfc ve diz\xfcst\xfc cihazlarla uyumludur.Yak\u0131n zamanda yap\u0131lacak d\xfczenlemeler ve eklenecek \xf6zellikler \u015funlard\u0131r:",null,null,null,null,null,null,null,null)
B.Ow=new A.bE("\n             Flutter'da halihaz\u0131rda var olan Lint paketi zaten kodlar\u0131n d\xfczg\xfcn bir \u015fekilde yaz\u0131lmas\u0131na yard\u0131mc\u0131 oluyor.\n\n             \u0130\u015f mant\u0131\u011f\u0131 kodlar\u0131n\u0131 aray\xfcz kodlar\u0131ndan ay\u0131rmak ve hatta widgetlar\u0131 da ayr\u0131 ayr\u0131 b\xf6lmek okunabilirlik a\xe7\u0131s\u0131ndan daha iyi olacak ve kod blo\u011fu tekrarlar\u0131n\u0131 da engelleyecektir.",null,null,null,null,null,null,null,null)
